import React from'react';

import Store from '../Store';

class Sections extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <button onClick={() => Store.page = 'about'}>About</button>
        <button onClick={() => Store.page = 'notes'}>Notes</button>
      </div>
    );
  }
}

export default Sections;
